javascript;
Copier;
import React from "react";
import iconFeature1 from "../public/image/icone/icon-chat.png";
import iconFeature2 from "../public/image/icone/icon-money.png";
import iconFeature3 from "../public/image/icone/icon-security.png";

function FeatureItem({ featureIndex, title, description }) {
  let iconSrc;
  switch (featureIndex) {
    case 1:
      iconSrc = iconFeature1;
      break;
    case 2:
      iconSrc = iconFeature2;
      break;
    case 3:
      iconSrc = iconFeature3;
      break;
    default:
      iconSrc = "";
  }

  return (
    <div className="feature-item">
      <img src={iconSrc} alt="Feature Icon" className="feature-icon" />
      <h3 className="feature-item-title">{title}</h3>
      <p>{description}</p>
    </div>
  );
}

export default FeatureItem;
